import React from "react";
import Prompt from "../Prompt/Prompt";
import AnswerBox from "../AnswerBox/AnswerBox";

function SurveyBox(props) {
  const response = "meep";
  setTimeout(() => {
    props.setResponseBank(response, props.currentQuestion);
  }, 100);
  // console.log(props.responseBank)

  return (
    <div>
      <Prompt
        number={props.questionBank[props.currentQuestion]["question-id"]}
        prompt={props.questionBank[props.currentQuestion]["question"]}
      />
      <AnswerBox
        answers={props.questionBank[props.currentQuestion]["answers"]}
        responseBank={props.responseBank}
        setResponseBank={props.handleSetResponseBank}
        currentQuestion={props.currentQuestion}
        setCurrentQuestion={props.handleSetCurrentQuestion}
        currentStage={props.currentStage}
        setCurrentStage={props.handleSetCurrentStage}
      />
    </div>
  );
}

export default SurveyBox;
